  return (
    <div>
      <h1 className="text-center">Let's introduce our Doctors</h1>

      <div className="row d-flex justify-content-center">
        {data.map((doctor) => (
          <ShowDoc doctor={doctor}></ShowDoc>
        ))}
      </div>
    </div>
  )
}

export default Doctors
